def closest_players_by_rating(player_name, player_ov_rating):
    dist_arr = []
    ret_arr = []
    ov_arr = []
    for i in range(len(player_ratings)):
        dist = abs(player_ov_rating - player_ratings[i][3])
        dist_arr.append(dist)

    # Sort elements based off closest to player rating
    closest = counting_sort(dist_arr, player_ratings)
    for player in closest[0:31]:

        if player[0] != player_name:
            ret_arr.append(player)
            ov_arr.append(player[3])
        
    ret_arr = counting_sort(ov_arr,ret_arr)
    ret_arr.reverse()
    return ret_arr
    